// List of Counters
import Counter from "./Counter";

export default function CounterList(props) {
    let counters = [];
    for(let i = 0; i < props.counters; i++) {
        counters.push(
            <Counter key={i} />
        )
    }
    return(
        <div className="container-row">
            {counters}
        </div>
    )
}
